Create a new file called `DataList.js` in the `my-app/src` directory and add the following code:
```
import React, { useState, useEffect } from 'react';

function DataList() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch('/api/data')
      .then(response => response.json())
      .then(data => setData(data));
  }, []);

  return (
    <div>
      <h1>Data List</h1>
      <ul>
        {data.map(item => (
